import { MainBodyBox } from "../style";
import { Footer } from "./Footer";
import { Header } from "./Header";

export const MainBody = ({ children, filter, setFilter }: MainBodyI) => {
  return (
    <MainBodyBox>
      <Header filter={filter} setFilter={setFilter} />
      {children}
    </MainBodyBox>
  );
};
